ution;  factory User.fromJson(Map<String, dynamic> json) => User(    type: json["type"],    id: json["_id"],    firstname: json["firstname"],    lastname: json["lastname"],    contact: json["contact"],    batch: json["batch"],    institution: json["institution"],  );  Map<String, dynamic> toJson() => {    "type": type,    "_id": id,    "firstname": firstname,    "lastname": lastname,    "contact": contact,    "batch": batch,    "institution": institution,  };}